import React, { useState, useEffect } from 'react';

const SearchBox = ({ handleSearch }) => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleChange = (e) => {
    const term = e.target.value;
    setSearchTerm(term);
    handleSearch(term);
  };

  return (
    <input
      type="text"
      placeholder="Search..."
      value={searchTerm}
      onChange={handleChange}
      style={{ marginBottom: '10px' }}
    />
  );
};

const Navbar = () => {
  const [formData, setFormData] = useState({
    VendorName: '',
    VendorContact: '',
    VendorEMail: '',
    VendorAddress: '',
    VendorRemark: '',
    UpdatedBy: '',
    Date: '',
    Action: ''
  });

  const [VendorName, setVendor] = useState([]);
  const [filteredVendorName, setFilteredVendorName] = useState([]);

  useEffect(() => {
    setFilteredVendorName(VendorName);
  }, [VendorName]);

  const handleChange = (e, rowIndex, columnName) => {
    const { value } = e.target;
    const updatedVendor = VendorName.map((Vendor, index) => {
      if (index === rowIndex) {
        return {
          ...Vendor,
          [columnName]: value
        };
      }
      return Vendor;
    });
    setVendor(updatedVendor);
    setFilteredVendorName(updatedVendor);
  };

  const handleAddRow = () => {
    setVendor([...VendorName, formData]);
    setFormData({
      VendorName: '',
      VendorContact: '',
      VendorEMail: '',
      VendorAddress: '',
      VendorRemark: '',
      UpdatedBy: '',
      Date: '',
      Action: ''
    });
  };

  const handleSearch = (searchTerm) => {
    console.log("Search term:", searchTerm);
    const filteredVendorName = VendorName.filter(Vendor => {
      return Object.values(Vendor).some(value =>
        value.toLowerCase().includes(searchTerm.toLowerCase())
      );
    });
    console.log("Filtered accounts:", filteredVendorName);
    setFilteredVendorName(filteredVendorName);
  };

  return (
    <div className='containerStyle' style={{ backgroundColor: 'white', padding: '10px' }}>
      <div style={{ color: 'black', backgroundColor: '#5DADE2', display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '10px 20px' }}>
        <div>
          <h1 style={{ margin: 0 }}>Vendor Add</h1>
        </div>
        <div>
          <label htmlFor="languageSelect" style={{ marginRight: '20px', marginBottom: 0 }}>Language:</label>
          <select id="languageSelect" style={{ height: '20%' }}>
            <option value="english">English</option>
            <option value="hindi">Hindi</option>
          </select>
        </div>
        <a className="nav-link" href="/" style={{ position: 'absolute', left: 0, top: 0 }}>
          {/* Home Icon */}
        </a>
      </div>

      <form style={{ display: 'grid', gridTemplateColumns: '1fr', gap: '20px' }}>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="Vendor Name">Vendor Name : </label>
          <input type="text" id="VendorName" name="VendorName" value={formData.VendorName} onChange={(e) => setFormData({ ...formData, VendorName: e.target.value })} />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="VendorContact">Vendor Contact : </label>
          <input type="text" id="VendorContact" name="VendorContact" value={formData.VendorContact} onChange={(e) => setFormData({ ...formData, VendorContact: e.target.value })} />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="VendorEMail">Vendor EMail : </label>
          <input type="text" id="VendorEMail" name="VendorEMail" value={formData.VendorEMail} onChange={(e) => setFormData({ ...formData, VendorEMail: e.target.value })} />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="VendorAddress">Vendor Address : </label>
          <input type="text" id="VendorAddress" name="VendorAddress" value={formData.VendorAddress} onChange={(e) => setFormData({ ...formData, VendorAddress: e.target.value })} />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="VendorRemark">Vendor Remark : </label>
          <input type="text" id="VendorRemark" name="VendorRemark" value={formData.VendorRemark} onChange={(e) => setFormData({ ...formData, VendorRemark: e.target.value })} />
        </div>
        <div style={{ textAlign: 'center' }}>
          <button className="btn btn-outline-success" type="button" onClick={handleAddRow}>Submit</button>
        </div>
      </form>

      <div style={{ backgroundColor: '#5DADE2', display: 'flex', alignItems: 'center', justifyContent: 'center', margin: '20px 0', padding: '10px' }}>
        <h1 style={{ margin: 0 }}>Vendor List</h1>
      </div>

      <div style={{ margin: '0 auto', maxWidth: '100%', overflowX: 'auto', padding: '10px' }}>
        <SearchBox handleSearch={handleSearch} />
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Vendor Name</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Vendor Contact</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Vendor EMail</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Vendor Address</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Vendor Remark</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Updated By</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Date</th>
              <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Action</th>
            </tr>
          </thead>
          <tbody>
            {filteredVendorName.map((vendor, rowIndex) => (
              <tr key={rowIndex}>
                {Object.entries(vendor).map(([columnName, value], colIndex) => (
                  <td key={colIndex} style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>
                    <input
                      type="text"
                      value={value}
                      onChange={(e) => handleChange(e, rowIndex, columnName)}
                      style={{ width: '0%' }}
                    />
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Navbar;
